INSERT INTO `noticias` (`id_noticia`, `titulo`, `subtitulo`, `etiquetas`, `imagen`, `cuerpo`, `fecha`, `id_usuario`) VALUES
(1, 'La Batalla m&aacute;s intensa.', 'Fortnine', 'Gaming,Free,Fortnite,BattleRoyale', , 'Battle Royale de Fortnite es un modo JcJ con 100 jugadores GRATUITO. Un mapa enorme. Un autob&uacute;s de batalla. La pericia de construcci&oacute;n y los entornos destructibles de Fortnite sumados a la intensidad de los combates JcJ. El &Uacute;ltimo en pie gana. Disponible en PC, PlayStation 4, Xbox One, Nintendo Switch, Android, iOS y Mac', '2019-11-01 16:43:30', 2);
INSERT INTO `noticias` (`id_noticia`, `titulo`, `subtitulo`, `etiquetas`, `imagen`, `cuerpo`, `fecha`, `id_usuario`) VALUES
(2, 'Nintendo Switch.', 'Nintendo', 'Gaming,Nintendo,SmashBros', , 'La nueva consola de Nintendo, La nintendo switch ha alcanzado un record de ventas en el mes de julio con juegos cl&aacute;sicos como Super Smash Bross', '2019-11-01 17:11:15', 2);
INSERT INTO `noticias` (`id_noticia`, `titulo`, `subtitulo`, `etiquetas`, `imagen`, `cuerpo`, `fecha`, `id_usuario`) VALUES
(3, 'Death Stranding llega con un ligero retraso', 'Nuevos retrasos en el videojuego de Kojima', 'Gaming,PS4,Kojima', , 'El pr&oacute;ximo y muy esperado lanzamiento de Kojima Productions, Death Stranding, lleva a&ntilde;os rodeado de misterio. Sin embargo, una entrevista del creador, Hideo Kojima, publicada por J-Wave, nos ofrece una actualizaci&oacute;n sobre el estado del desarrollo.<br />\r\n<br />\r\nEn la entrevista, Kojima confirma que se trata de un juego de mundo abierto, algo sobre lo que se llevaba especulando un tiempo. Adem&aacute;s, ha hablado sobre c&oacute;mo trabaja el equipo, y sobre la fecha de lanzamiento.<br />\r\n<br />\r\nEl creador del videojuego ha asegurado que la historia ya est&aacute; completa de principio a fin, pero como es un mundo abierto, todav&iacute;&shy;a queda mucho que pulir. Dice que juega todos los d&iacute;&shy;as a Death Stranding y va informando al equipo de los peque&ntilde;os cambios y modificaciones que tienen que hacer. De esta forma, el equipo se va ajustando al proceso de trabajo.<br />\r\n<br />\r\nOtra de las novedades, aunque sigamos sin saber la fecha de lanzamiento, es que por lo visto, llevan retraso con respecto a sus planes originales. No obstante, Kojima informa de que no es una demora muy grande. Como no sabemos cuando saldr&aacute;, tampoco podemos entristecernos demasiado. Al menos, tenemos el consuelo de que est&aacute;n trabajando en ello, por lo que no es un proyecto olvidado.<br />\r\n<br />\r\nEs m&aacute;s, Kojima ha comentado que trabajar con una fecha l&iacute;mite le ayuda a establecer sus prioridades. Aunque le gustar&iacute;&shy;a poder dedicarse a todos los detalles hasta estar completamente satisfecho, sabe que contar con un plazo establecido lo hace trabajar con un objetivo claro.<br />\r\n<br />\r\nDeath Stranding cuenta con todo un equipo de profesionales en su historia. Inicialmente, Norman Reedus (m&aacute;s conocido como Daryl en The Walking Dead) iba a ser el protagonista de Silent Hills. Sin embargo, cuando el proyecto se cancel&oacute;, sigui&oacute; trabajando con Kojima y podremos verlo en el nuevo lanzamiento. Otras caras conocidas como Guillermo del Toro (El Laberinto del Fauno, Hellboy) o Mads Mikkelsen (Doctor Strange, Monstruos S. A.) tambi&eacute;n forman parte del elenco del juego.', '2019-11-01 23:57:18', 2);
INSERT INTO `noticias` (`id_noticia`, `titulo`, `subtitulo`, `etiquetas`, `imagen`, `cuerpo`, `fecha`, `id_usuario`) VALUES
(4, '&iquest;C&oacute;mo es jugar a Overwatch 2?', 'Comparten casi dos horas de gameplay con material PvE y PvP', ' Overwatch 2, Blizzard, BlizzCon 2019', , 'Uno de los principales anuncios que Blizzard ha llevado a la BlizzCon 2019 es Overwatch 2, secuela del popular hero arena de 2016. Durante la ceremonia de apertura del evento hemos podido ver un tr&aacute;iler gameplay y una cinem&aacute;tica, pero m&aacute;s tarde los asistentes tuvieron la ocasi&oacute;n de probar in situ (y retransmitir) una demo del juego.<br />\r\n<br />\r\nEl video que recogemos, del youtuber ohnickel, contiene material PvE y PvP de esta entrega. Como puedes comprobar por ti mismo, ambas vertientes comparten muchos aspectos del Overwatch original en t&eacute;rminos de mec&aacute;nicas y contenido, solo que mucho m&aacute;s refinado. La interfaz y el dise&ntilde;o de algunos personajes se han perfilado para OW2, aunque las habilidades de estos se han mantenido intactas.<br />\r\n<br />\r\nAs&iacute; pues, las novedades de mayor peso residen en la posibilidad de mejorar y personalizar estas habilidades para la modalidad PvE, equiparnos algunos objetos, o la posibilidad de ver secuencias programadas durante las misiones. El PvP es mucho m&aacute;s conservador, pues a fin de cuentas compartir&aacute; comunidad con Overwatch 1, pero cuenta con el nuevo modo Push.', '2019-11-02 12:30:48', 4);
INSERT INTO `noticias` (`id_noticia`, `titulo`, `subtitulo`, `etiquetas`, `imagen`, `cuerpo`, `fecha`, `id_usuario`) VALUES
(5, 'NFS Heat muestra su ciclo de d&iacute;a y noche', 'Nos muestran c&oacute;mo se juega con el nuevo t&iacute;tulo de velocidad', 'NFS, Carreras, PlayStation ', , 'A trav&eacute;s de PlayStation Underground nos llega una demostraci&oacute;n de la jugabilidad de Need for Speed: Heat, el nuevo t&iacute;tulo de la saga de velocidad de Electronic Arts donde nos muestran el ciclo de d&iacute;a y noche.<br />\r\n<br />\r\nEstamos ante una de las sagas m&aacute;s longevas de la velocidad en el mundo de los videojuegos con m&aacute;s de 25 a&ntilde;os de trayectoria y capaz de acumular m&aacute;s 150 millones de unidades. Cuando se anunci&Atilde;&sup3; su vuelta tras el peque&ntilde;o traspi&eacute;s de Payback, EA y Ghost Games prometieron una vuelta a las ra&iacute;ces, a la idea de correr por el hecho de pasarlo bien y escapar de la polic&iacute;a.<br />\r\n<br />\r\nDesechando algunas de las ideas anteriores, se decidi&oacute; volver al origen, a lo b&aacute;sico, y Need for Speed Heat ser&aacute; la culminaci&oacute;n de este tipo de promesas y preceptos.<br />\r\n<br />\r\nPor tanto, Ghost Games ha decidido cambiar de planteamiento y dise&ntilde;o ofreci&eacute;ndonos una visita a Palm City, una ciudad enorme llena de ambientes festivos que nos invitar&aacute; a recorrerla a trav&eacute;s de competiciones y torneos espectaculares por el d&iacute;a y a memorizar sus calles y avenidas por la noche con carreras ilegales mientras intentamos esquivar a la polic&iacute;a y sus envites.<br />\r\n<br />\r\nEso s&iacute;, se mantendr&aacute; fiel a la tradici&oacute;n de darnos muchos coches y una banda sonora cuidada que, como la iluminaci&oacute;n, se adaptar&aacute; a la hora del d&iacute;a.<br />\r\n', '2019-11-02 21:56:18', 2);
INSERT INTO `noticias` (`id_noticia`, `titulo`, `subtitulo`, `etiquetas`, `imagen`, `cuerpo`, `fecha`, `id_usuario`) VALUES
(6, 'Terminator: Resistance debutar&aacute; despu&eacute;s de lo esperado', 'El nuevo tr&aacute;iler del FPS est&aacute; lleno de acci&oacute;n', 'terminator, pcgaming, PlayStation 4 xbox one', , 'Teyon y Reef Entertainment anunciaron hace algunos meses Terminator: Resistance, un FPS basado en la popular franquicia de acci&oacute;n y ciencia ficci&oacute;n. Te tenemos una mala noticia si espera su estreno, pues fue retrasado en Am&eacute;rica.<br />\r\n<br />\r\nEl lanzamiento del t&iacute;tulo estaba planeado para el 3 de diciembre de este a&ntilde;o en nuestra regi&oacute;n. Sin embargo, los estudios decidieron retrasarlo. El juego mantiene su fecha de estreno en Europa, donde estar&aacute; disponible el 15 de noviembre.<br />\r\n<br />\r\nAhora, Terminator: Resistance estar&aacute; disponible en nuestra regi&oacute;n hasta el 10 de diciembre, as&iacute; que la espera adicional no ser&aacute; tan larga. Su lanzamiento sigue planeado para PlayStation 4, Xbox One y PC. Para acompa&ntilde;ar la noticia, los estudios revelaron m&aacute;s gameplay.<br />\r\n', '2019-11-03 11:48:37', 9);
INSERT INTO `noticias` (`id_noticia`, `titulo`, `subtitulo`, `etiquetas`, `imagen`, `cuerpo`, `fecha`, `id_usuario`) VALUES
(7, 'Mario Kart Tour llegar&aacute; pronto a esta ciudad', 'Nintendo confirm&oacute; la pr&oacute;xima pista tem&aacute;tica', 'Mario Kart Tour, Mario Kart, movil', , 'Nintendo prepara varias novedades para Mario Kart Tour. El t&iacute;tulo para m&oacute;viles est&aacute; por concluir sus copas tem&aacute;ticas de Halloween, as&iacute; que la compa&ntilde;&iacute;a ya revel&oacute; los primeros detalles de la pr&oacute;xima etapa del juego para m&oacute;viles.<br />\r\n<br />\r\nMario Kart Tour ha tenido pistas tem&aacute;ticas basadas en diversas ciudades del mundo, como Nueva York y Tokyo. Nintendo seguir&aacute; con este concepto para el juego, por lo que un nuevo circuito especial viene en camino.<br />\r\n<br />\r\nNintendo confirm&oacute; que Mario Kart Tour ahora llegar&aacute; a Francia, pues tendr&aacute; un circuito especial de Par&iacute;s. El tour en dicha ciudad iniciar&aacute; el pr&oacute;ximo 5 de noviembre, as&iacute; que solo faltan algunos d&iacute;as para su inicio.<br />\r\n<br />\r\nLa compa&ntilde;&iacute;a no ha revelado todos los detalles del tour, pero podemos esperar m&aacute;s pilotos, personajes con atuendos especiales, as&iacute; como coches, alas y otros circuitos de la franquicia. Abajo puedes ver la primera imagen de la pista de Par&iacute;s.<br />\r\n', '2019-11-03 11:53:01', 2);
INSERT INTO `noticias` (`id_noticia`, `titulo`, `subtitulo`, `etiquetas`, `imagen`, `cuerpo`, `fecha`, `id_usuario`) VALUES
(8, 'Call of Duty Modern Warfare fue lo m&aacute;s descargado de octubre de 2019', 'La tienda digital de PlayStation 4 se rinde al t&iacute;tulo de acci&oacute;n de Activision e Infini', 'Call Of Duty, PS4', , 'Sony ha anunciado, a trav&eacute;s de su blog oficial cu&aacute;les han sido los videojuegos m&aacute;s descargados del mes de octubre en PlayStation Store, la tienda digital de PlayStation 4. Pocas sorpresas: Call of Duty: Modern Warfare irrumpe con fuerza en el top y le arrebata el primer puesto a FIFA 20, l&iacute;der indiscutible hasta la fecha.<br />\r\n<br />\r\nCall of Duty: Modern Warfare es un &eacute;xito sin precedentes para Activision. El nuevo videojuego de acci&oacute;n en primera persona, desarrollado por Infinity Ward, logr&oacute; recaudar m&aacute;s de 600 millones de d&oacute;lares en su lanzamiento el pasado 25 de octubre, convirti&eacute;ndose en toda una bestia l&uacute;dica capaz de congregar a m&aacute;s jugadores durante su primer fin de semana que ning&uacute;n otro juego en los &uacute;ltimos seis a&ntilde;os. Las cifras marean ellas solas, demostr&aacute;ndonos el poder de convocatoria. En formato f&iacute;sico, seg&uacute;n nos informa GAME, tambi&eacute;n ha sido un triunfo para la editora.<br />\r\n<br />\r\nAunque Call of Duty es el &eacute;xito m&aacute;s importante del mes, no es la &uacute;nica novedad del top. Ghost Recon Breakpoint es la otra novedad de octubre. El shooter t&aacute;ctico de Ubisoft se ha alzado con el cuarto puesto, y aunque la empresa esperaba m&aacute;s de este videojuego seg&uacute;n sus demoledoras declaraciones, su puesto en este listado digital ejemplifica la importancia de la saga para el grueso de jugadores de PlayStation 4. Por otra parte, el videojuego de rol Obsidian, The Outer Worlds, alcanz&oacute; el s&eacute;ptimo lugar, mientras que el remake de MediEvil, un cl&aacute;sico de PlayStation, se col&oacute; en el noveno puesto. A continuaci&oacute;n os dejamos con las listas completas por plataformas -PlayStation 4 y PS VR- as&iacute; como de contenidos descargables y de videojuegos gratuitos.<br />\r\n', '2019-11-06 16:01:03', 9);
INSERT INTO `noticias` (`id_noticia`, `titulo`, `subtitulo`, `etiquetas`, `imagen`, `cuerpo`, `fecha`, `id_usuario`) VALUES
(9, 'Death Stranding: Tendremos libertad en su jugabilidad, pero no en la historia', 'Hideo Kojima se&ntilde;ala que los jugadores no podr&aacute;n escapar de la historia principal', 'Death Stranding, PS4', , 'Hideo Kojima ha intentado encontrar el balance perfecto para Death Stranding en cuanto a la libertad que ofrece al jugador. El desarrollador japon&eacute;s ha encontrado la f&oacute;rmula perfecta estableciendo lo siguiente: si bien en el mundo del juego podremos ir a donde queramos y hacer lo que nos venga en gana, no podremos escapar de la narrativa. &quot;Si el personaje est&aacute; destinado a morir, el jugador no puede evitar eso&quot;, explica Kojima.<br />\r\n<br />\r\n&quot;Como un juego de acci&oacute;n de mundo abierto, puedes ir a cualquier parte, &iquest;cierto? Y puedes hacer cualquier cosa&quot;, explica Kojima durante un panel de EGX Berlin (v&iacute;a Metal Gear Informer). &quot;T&uacute; decides qu&eacute; hacer. Porque si no puedes, no es realmente divertido, &iquest;verdad? Pero en cuanto a la narrativa, la historia misma debe ser como un destino&quot;.<br />\r\n<br />\r\nEn este sentido, Kojima sostiene lo siguiente: &quot;Si el personaje est&aacute; destinado a morir, vosotros [los jugadores] no pod&eacute;is evitar eso. (...) Es un destino. Entonces, en cuanto a la libertad del juego, el destino y el tiempo en que transcurre en la historia... trato de equilibrar ambos mundos. Es dif&iacute;cil equilibrar, pero creo que hay formas de equilibrar eso realmente&quot;.<br />\r\n<br />\r\nKojima tambi&eacute;n detall&oacute; que, aunque en t&eacute;rminos de jugabilidad o aspectos t&eacute;cnicos est&aacute; dispuesto a escuchar los comentarios de los jugadores sobre lo que les gusta y lo que deber&aacute; cambiar, el creativo esgrime que la historia y la tem&aacute;tica se mantienen inamovibles.<br />\r\n<br />\r\n&quot;El tema de la historia tengo que sacarlo yo mismo&quot;, indica. &quot;En los videojuegos, los usuarios realmente controlan lo que va a suponer el juego final. As&iacute; que tengo que pensar en la interfaz de usuario o en la misma jugabilidad. Entonces, escucho a los usuarios porque los jugadores son parte de eso, y son los que van a tener que jugarlo. As&iacute; que estoy pendiente, escucho lo que dicen y lo modifico. Pero no la historia. Eso s&oacute;lo me concierne a m&iacute;&shy;&quot;.<br />\r\n<br />\r\nEl mundo de Death Stranding pone sobre la mesa la situaci&oacute;n del mundo actual: una sociedad donde las personas est&aacute;n cada vez m&aacute;s conectadas gracias a los avances tecnol&oacute;gicos pero, al mismo tiempo, estos son los responsables de que estemos cada vez m&aacute;s separados. Es por eso que Hideo Kojima pretende que Death Stranding sirva para reflexionar sobre cuestiones como el muro de Donald Trump o sobre el Brexit de Reino Unido. &quot;La era actual se basa en el individualismo&quot;, sosten&iacute;&shy;a Kojima.', '2019-11-06 16:05:16', 2);
INSERT INTO `noticias` (`id_noticia`, `titulo`, `subtitulo`, `etiquetas`, `imagen`, `cuerpo`, `fecha`, `id_usuario`) VALUES
(10, 'Destiny 2 presenta Gran Maestro, la versi&oacute;n m&aacute;s dura y generosa de sus asaltos de Ocas', 'Bungie asegura estar atento a las impresiones y sugerencias que giran en torno a la temporada actual', 'Destiny 2, Bungie', , 'Como parte de la hoja de ruta de la Temporada de los Dignos, Bungie llevar&aacute; pronto a Destiny 2 una nueva opci&oacute;n de dificultad para los asaltos de Ocaso - Suplicio: Gran Maestro. En su &uacute;ltimo bolet&iacute;n semanal, los padres de Halo anticipan varios detalles sobre esta novedad, que estar&aacute; disponible el pr&oacute;ximo 21 de abril y marcar&aacute; una de las actividades PvE definitivas de esta temporada.<br />\r\n<br />\r\nDe acuerdo con sus indicaciones, Gran Maestro estar&aacute; fundamentado en la configuraci&oacute;n maestro del Suplicio, aunque l&oacute;gicamente ser&aacute; a&uacute;n m&aacute;s duro. A diferencia de las dificultades inferiores, donde debemos balancear el tiempo de compleci&oacute;n con los puntos otorgados al derrotar oponentes, aqu&iacute; el objetivo es simple y llanamente completar la misi&oacute;n. Algo que requerir&aacute; tiempo, estrategia, comunicaci&oacute;n y habilidad.<br />\r\n<br />\r\nLos campeones jugar&aacute;n un papel clave, ya que al derrotarlos restauraremos fichas de resurrecci&oacute;n. Si todo el equipo cae a la vez, volver&aacute;n a &oacute;rbita para empezar desde cero. Sus responsables aseguran tener m&aacute;s sorpresas bajo la manga, pero tendremos que esperar para descubrirlas. Por otro lado, explican que aunque el nivel de la actividad sea 1050, no conseguiremos ninguna ventaja en ella a partir del nivel de personaje 1025 para mantener el delta de dificultad en su punto.<br />\r\n<br />\r\nAdem&aacute;s de las recompensas en obra maestra y materiales excepcionales que nos aguardan al final de la actividad, quienes completen todos los Suplicios en dificultad Gran Maestro durante la temporada obtendr&aacute;n el nuevo sello de Conquistador. \"Queremos que sea uno de los t&iacute;tulos que supongan un mayor desaf&iacute;o, pero tambi&eacute;n nos gustar&iacute;a que estuviera al alcance de cualquier persona que le dedique tiempo y esfuerzo con su equipo durante una temporada determinada\" explican sus responsables.<br />\r\n<br />\r\nPor otro lado, desde los foros aseguran estar al tanto de las impresiones y recomendaciones de los usuarios acerca de las Pruebas de Osiris y otros elementos de la temporada, y que hay mejoras en camino incluso si no se han anunciado a&uacute;n. \"Es un tost&oacute;n que las cosas lleven tiempo. A muchos nos gustar&iacute;a decir \'esto es exactamente lo que estamos haciendo, y cu&aacute;ndo esperamos sacar el parche\' pero acelerar la correcci&oacute;n de problemas puede dar pie a m&aacute;s problemas que impactar&aacute;n a&uacute;n m&aacute;s en vuestro disfrute del juego\".', '2020-04-11 17:33:45', 9);
INSERT INTO `noticias` (`id_noticia`, `titulo`, `subtitulo`, `etiquetas`, `imagen`, `cuerpo`, `fecha`, `id_usuario`) VALUES
(11, 'Cyberpunk 2077 publicar&aacute; sus DLC siguiendo los pasos de The Witcher 3', 'Los jugadores pueden esperar que este t&iacute;tulo dist&oacute;pico ofrezca, al menos, dos enormes ', 'Cyberpunk 2077, CD Project Red', , 'Cyberpunk 2077 se prepara para debutar el pr&oacute;ximo 17 de septiembre tanto en PC como en PS4 y Xbox One, pero ah&iacute; no se acabar&aacute;n las aventuras de los jugadores en Night City. CD Projekt RED ha confirmado que su nuevo y ambicioso t&iacute;tulo publicar&aacute; sus DLC siguiendo la hoja de ruta marcada por el popular The Witcher 3: Wild Hunt. Eso quiere decir que, al menos, podemos esperar dos enormes expansiones al estilo de Hearts of Stone y Blood &amp; Wine.<br />\r\n<br />\r\nDurante una reciente sesi&oacute;n de preguntas y respuestas con sus inversores, el presidente de CD Projekt, Adam Kicinski, abord&oacute; la cuesti&oacute;n del contenido posterior al lanzamiento de Cyberpunk 2077. En este sentido, Kicinski no dud&oacute; a la hora de se&ntilde;alar que el ambicioso juego dist&oacute;pico recibir&aacute; su contenido adicional de manera similar a lo que el estudio realiz&oacute; con The Witcher 3: Wild Hunt. Teniendo en cuenta que Cyberpunk 2077 debutar&aacute; en septiembre, es posible que meses despu&eacute;s tengamos noticias del primer DLC.<br />\r\n<br />\r\nTengamos en cuenta que The Witcher 3 debut&oacute; en el mes de mayo de 2015 y su primera expansi&oacute;n, Hearts of Stone, lleg&oacute; unos cinco meses despu&eacute;s: en octubre del mismo a&ntilde;o. Suponiendo que CD Projekt dedique la misma cantidad de tiempo - aproximadamente - para desarrollar el DLC de Cyberpunk 2077, quiz&aacute; su primer contenido adicional llegue a principios del pr&oacute;ximo a&ntilde;o. Pero tendremos que esperar a que el estudio polaco confirme las fechas de salida.<br />\r\n<br />\r\nPor otro lado, Kicinski tambi&eacute;n confirm&oacute; que Cyberpunk 2077 no tendr&aacute; &quot;menos expansiones que The Witcher 3&quot;. Esto significa que, al menos, podemos esperar dos DLC para el t&iacute;tulo. Lo que est&aacute; claro es que Cyberpunk 2077 gozar&aacute; de contenido m&aacute;s que de sobra para mantenernos entretenidos: el estudio habl&oacute; recientemente de las &quot;historias de calle&quot;, similares a los contratos de brujo de The Witcher, y que suponen 75 misiones adicionales.<br />\r\n<br />\r\nCyberpunk 2077 estaba previsto para debutar en el mes de abril, pero CD Projekt RED finalmente retras&oacute; su fecha de lanzamiento al pr&oacute;ximo mes de septiembre; una decisi&oacute;n que no estuvo exenta de pol&eacute;mica, ya que el propio Kicinski confirm&oacute; que el equipo de desarrollo tendr&iacute;a que enfrentarse al crunch debido a este retraso.', '2020-04-12 18:49:27', 4);
INSERT INTO `noticias` (`id_noticia`, `titulo`, `subtitulo`, `etiquetas`, `imagen`, `cuerpo`, `fecha`, `id_usuario`) VALUES
(12, 'Call of Duty Warzone soportar&aacute; modo para 200 jugadores esta semana', 'Prepara tu disco duro para otra descarga masiva.', 'CoD, Warzone, Modern Warfare', , 'Como ya es costumbre, Warzone, el battle-royale para Call of Duty: Modern Warfare, sigue evolucionando e Infinity Ward acaba de anunciar que el 30 de junio, a&ntilde;adir&aacute; soporte para 200 jugadores al campo de batalla, lo que supone un incremento de 50 sobre el conteo original de Warzone y 100 sobre el formato tradicional de la modalidad.<br />\n<br />\nPor supuesto, lo anterior traer&aacute; consigo otra temida y voluminosa descarga, esta vez de entre 22 y 36 GB, y no s&oacute;lo eso, sino que vendr&aacute; con una peque&ntilde;a sorpresa. &quot;Los due&ntilde;os de consola tendr&aacute;n que instalar una descarga secundaria de 3.5 GB aproximadamente, luego de lo cual deber&aacute;n reiniciar el juego para acceder al multijugador, si as&iacute; lo desean.&quot;<br />\n<br />\nInfinity Ward no dud&oacute; en recordar a los jugadores que en el men&uacute; general de opciones existe una herramienta que permite eliminar paquetes de datos, de entre los cuales, el de Operaciones Especiales se perfila como la v&iacute;ctima ideal si hace falta algo de espacio.<br />\n<br />\nAsimismo, Infinity Ward adelant&oacute; que Warzone recibir&aacute; algunas novedades, como Contratos especiales, donde deber&aacute;s llegar al punto de compra designado en el tiempo establecido para ser merecedor de descuentos; tambi&eacute;n habr&aacute; una variante, donde un paquete aerotransportado brinde acceso a un Juggernaut; y finalmente, a&ntilde;adir&aacute;n una lente para marcar enemigos a la distancia.<br />\n<br />\nEso para Warzone, mientras que el multijugador tradicional recibir&aacute; el nuevo mapa Cheshire Park, as&iacute; como la variante de Captura de Bandera, Team Defender. Todo eso como parte del flujo continuo de contenidos de la Temporada 4 multijugador, que arranc&oacute; hace un par de semanas y deber&aacute; durar hasta comienzos de agosto.', '2020-06-30 01:28:33', 2);
INSERT INTO `noticias` (`id_noticia`, `titulo`, `subtitulo`, `etiquetas`, `imagen`, `cuerpo`, `fecha`, `id_usuario`) VALUES
(15, 'Otro juego gratis para celebrar la Navidad: consigue Prey de PC antes de que acabe la oferta', 'Epic Games Store a&uacute;n tiene unos cuantos juegos gratis m&aacute;s que ofrecer.', 'Prey, PC, Epic Games', , 'En un d&iacute;a tan especial como Navidad, Epic Games Store ofrece a los jugadores de PC la oportunidad de conseguir gratis por tiempo limitado uno de los grandes juegos de acci&oacute;n y aventuras de los &uacute;ltimos a&ntilde;os, el fant&aacute;stico Prey, que pod&eacute;is sumar a vuestra biblioteca virtual durante las pr&oacute;ximas 24 horas. &iexcl;No perd&aacute;is la oportunidad!<br />\n<br />\nSi no conoc&eacute;is este juego de Arkane y Bethesda, como te contamos en nuestro an&aacute;lisis de Prey, aunque a veces &quot;querer ofrecer tanto juega a en su contra&quot;, explorar la Talos 1 y luchar contra sus temibles alien&iacute;genas es &quot;una experiencia s&oacute;lida y recomendable&quot; que sorprende por la libertad de acci&oacute;n que pone en tus manos.<br />\n<br />\nDesarrollado por los autores de la saga Dishonored o el m&aacute;s reciente Deathloop, en este juego cuentas con un variado arsenal de armas y gadgets con los que puedes resolver una misma situaci&oacute;n de formas muy dispares. A esto contribuye tambi&eacute;n el brillante dise&ntilde;o de escenarios, que nos deja con una bella y mort&iacute;fera estaci&oacute;n espacial plagada de caminos secundarios y secretos.<br />\n<br />\nComo ya sab&eacute;is Epic Games Store regalar&aacute; hasta 15 videojuegos en Navidad, por lo que todav&iacute;a quedan unos cuantos t&iacute;tulos gratis para descargar antes de que acabe el a&ntilde;o. Tras sorprendernos con opciones tan interesantes como el notable Loop Hero o ayer mismo, el primer Pathfinder, se especula con cu&aacute;l ser&aacute; el pr&oacute;ximo juego gratis de la promoci&oacute;n, y parece que este podr&iacute;a ser el espectacular Control de Remedy, padres entre otros de Max Payne y Alan Wake.', '2021-12-25 15:44:35', 2);
INSERT INTO `noticias` (`id_noticia`, `titulo`, `subtitulo`, `etiquetas`, `imagen`, `cuerpo`, `fecha`, `id_usuario`) VALUES
(16, 'Arcane recibe 9 nominaciones a los &Oacute;scar de la animaci&oacute;n', 'Los Premios Annie han elegido a la producci&oacute;n de Riot como una de las mejores de 2021.', 'Arcane, League of Legends, Netflix', , 'Que los videojuegos est&aacute;n cada vez m&aacute;s presentes en todos los &aacute;mbitos del entretenimiento de la sociedad es una realidad. Hay desde parques y merchandising hasta adaptaciones cinematogr&aacute;ficas, como la pel&iacute;cula de Uncharted o la serie de animaci&oacute;n de Netflix Arcane.<br />\n<br />\nEsta producci&oacute;n, basada en el universo de League of Legends de Riot Games, ha anunciado recientemente que ha recibido un total de 9 nominaciones a los Premios Annie, considerados los &#039;&Oacute;scar de la animaci&oacute;n&#039;. Se trata de unos galardones que otorga la International Animated Film Association cada a&ntilde;o, celebrando el pr&oacute;ximo febrero de 2022 su edici&oacute;n n&uacute;mero 49.<br />\n<br />\nEntre la lista de nominados, vemos que sus episodios han sido reconocidos en categor&iacute;as importantes como Mejor Guion o Mejor Direcci&oacute;n. Tambi&eacute;n hacen acto de presencia otros proyectos relacionados con el mundo de los videojuegos (aunque no tan directamente) como la pel&iacute;cula The Witcher: La Pesadilla del Lobo, que ha sido nominada a Mejor Producci&oacute;n Especial.<br />\n<br />\nNominaciones de Arcane en los Premios Annie<br />\n<br />\n*Nota: todas las categor&iacute;as est&aacute;n dentro de &#039;TV/Media&#039;, existen otras para pel&iacute;culas<br />\n<br />\nMejor producci&oacute;n para p&uacute;blico general: episodio When These Walls Come Tumbling Down<br />\nMejores Efectos Especiales: episodio Oil and Water<br />\nMejor Animaci&oacute;n de Personaje: episodio The Monster You Created<br />\nMejor Dise&ntilde;o de Personaje: episodio Some Mysteries Better Left Unsolved<br />\nMejor Direcci&oacute;n: episodio The Monster You Created<br />\nMejor Dise&ntilde;o de Producci&oacute;n: episodio Happy Progress Day!<br />\nMejor Storyboarding: episodio When These Walls Come Tumbling Down<br />\nMejor Actuaci&oacute;n de Voz: episodio When These Walls Come Tumbling Down<br />\nMejor Guion: episodio The Monster You Created<br />\n<br />\nMerece la pena destacar que Arcane ha recibido cr&iacute;ticas muy positivas por parte de prensa especializada y p&uacute;blico, por lo que no solo es cosa de los profesionales. Los fans esperan ahora la segunda temporada, aunque lamentablemente tardar&aacute; algo m&aacute;s de lo previsto en llegar. El propio CEO de Riot, Nicolo Laurent, confirm&oacute; que no la ver&iacute;amos a lo largo de 2022.', '2021-12-25 15:51:21', 9);

